css:
atom-text-editor.vim-mode-plus.normal-mode::shadow .cursor,
atom-text-editor.vim-mode-plus.operator-pending-mode::shadow .cursor,
atom-text-editor.vim-mode-plus.visual-mode::shadow .cursor,
atom-text-editor.vim-mode-plus.normal-mode .cursor,
atom-text-editor.vim-mode-plus.operator-pending-mode .cursor,
atom-text-editor.vim-mode-plus.visual-mode .cursor {
  border: 0;
  background-color: #000000;
  visibility: hidden;
  opacity: 0.5;
}
atom-text-editor.vim-mode-plus.normal-mode.is-focused::shadow .cursor,
atom-text-editor.vim-mode-plus.operator-pending-mode.is-focused::shadow .cursor,
atom-text-editor.vim-mode-plus.visual-mode.is-focused::shadow .cursor,
atom-text-editor.vim-mode-plus.normal-mode.is-focused .cursor,
atom-text-editor.vim-mode-plus.operator-pending-mode.is-focused .cursor,
atom-text-editor.vim-mode-plus.visual-mode.is-focused .cursor {
  border: 0;
  background-color: #000000;
  visibility: visible;
  opacity: 0.5;
}
atom-text-editor.vim-mode-plus.visual-mode::shadow .cursor.hidden-cursor,
atom-text-editor.vim-mode-plus.visual-mode .cursor.hidden-cursor {
  display: block;
}
atom-text-editor.vim-mode-plus.insert-mode.replace::shadow .cursor,
atom-text-editor.vim-mode-plus.insert-mode.replace .cursor {
  border: none;
  border-bottom: 0.3em solid #000000;
  background: none;
  visibility: hidden;
  opacity: 0.5;
}
atom-text-editor.vim-mode-plus.insert-mode.replace.is-focused::shadow .cursor,
atom-text-editor.vim-mode-plus.insert-mode.replace.is-focused .cursor {
  border: none;
  border-bottom: 0.3em solid #000000;
  background: none;
  visibility: visible;
  opacity: 0.5;
}
atom-text-editor.vim-mode-plus.insert-mode.replace.is-focused::shadow .cursors.blink-off .cursor,
atom-text-editor.vim-mode-plus.insert-mode.replace.is-focused .cursors.blink-off .cursor {
  border: none;
  border-bottom: 0.3em solid #000000;
  background: none;
  visibility: hidden;
  opacity: 0.5;
}
atom-text-editor.vim-mode-plus.operator-pending-mode::shadow .cursor,
atom-text-editor.vim-mode-plus.operator-pending-mode .cursor {
  border: none;
  border-bottom: 0.6em solid #000000;
  background: none;
  visibility: hidden;
  opacity: 0.5;
}
atom-text-editor.vim-mode-plus.operator-pending-mode.is-focused::shadow .cursor,
atom-text-editor.vim-mode-plus.operator-pending-mode.is-focused .cursor {
  border: none;
  border-bottom: 0.6em solid #000000;
  background: none;
  visibility: visible;
  opacity: 0.5;
}
atom-text-editor.vim-mode-plus.operator-pending-mode.is-focused::shadow .cursors.blink-off .cursor,
atom-text-editor.vim-mode-plus.operator-pending-mode.is-focused .cursors.blink-off .cursor {
  border: none;
  border-bottom: 0.6em solid #000000;
  background: none;
  visibility: hidden;
  opacity: 0.5;
}
atom-text-editor .vim-mode-plus-flash .region,
atom-text-editor::shadow .vim-mode-plus-flash .region {
  z-index: 1;
  background-color: rgba(102, 153, 204, 0.5);
}
atom-text-editor .vim-mode-plus-flash.added .region,
atom-text-editor::shadow .vim-mode-plus-flash.added .region {
  background-color: rgba(72, 89, 0, 0.5);
}
atom-text-editor .vim-mode-plus-flash.removed .region,
atom-text-editor::shadow .vim-mode-plus-flash.removed .region {
  background-color: rgba(221, 17, 68, 0.5);
}
atom-text-editor .vim-mode-plus-cursor-normal .region,
atom-text-editor::shadow .vim-mode-plus-cursor-normal .region {
  background-color: #000000;
  opacity: 0.5;
}
atom-text-editor .vim-mode-plus-cursor-insert .region,
atom-text-editor::shadow .vim-mode-plus-cursor-insert .region {
  background-color: #000000;
  opacity: 0.8;
}
.vim-mode-plus-hover {
  display: block;
  color: #2e2e2e;
  background-color: #ffffff;
  border-radius: 3px;
  box-shadow: 0 0 10px #555555;
  padding-left: 0.2em;
  padding-right: 0.2em;
  margin-left: -0.1em;
  text-align: center;
}
.vim-mode-plus-hover.first {
  background-color: #1f96ff;
}
.vim-mode-plus-hover.last {
  background-color: #d24b4b;
}
.vim-mode-plus-input atom-text-editor[mini] {
  background-color: inherit;
  border: none;
  width: 100%;
  height: 0px;
  font-weight: normal;
  color: #474747;
  line-height: 1.28;
  cursor: default;
  white-space: nowrap;
  padding-left: 10px;
}
.vim-mode-plus-input atom-text-editor[mini].is-focused {
  box-shadow: none;
}
.vim-mode-plus-search-container {
  display: flex;
}
.vim-mode-plus-search-container > div {
  padding: 5px 10px;
  border: none;
}
.vim-mode-plus-search-container .editor-container {
  width: 100%;
}
atom-text-editor[mini].vim-mode-plus-search {
  border: none;
  color: #474747;
  cursor: default;
}
atom-text-editor[mini].vim-mode-plus-search.is-focused {
  box-shadow: none;
}
atom-text-editor[mini].vim-mode-plus-search::before {
  font-size: 1.2em;
  padding-right: 0.5em;
  content: '/';
}
atom-text-editor[mini].vim-mode-plus-search.backwards::before {
  content: '?';
}
.vim-mode-plus.round-box {
  box-sizing: border-box;
  border-radius: 3px;
}
atom-text-editor .vim-mode-plus-search-match .region,
atom-text-editor::shadow .vim-mode-plus-search-match .region {
  box-sizing: border-box;
  border-radius: 3px;
  background-color: transparent;
  border: 1px solid #999999;
}
atom-text-editor .vim-mode-plus-search-match.first .region,
atom-text-editor::shadow .vim-mode-plus-search-match.first .region {
  border: 1px solid #96cbfe;
}
atom-text-editor .vim-mode-plus-search-match.last .region,
atom-text-editor::shadow .vim-mode-plus-search-match.last .region {
  border: 1px solid #dd1144;
}
atom-text-editor .vim-mode-plus-search-match.current .region,
atom-text-editor::shadow .vim-mode-plus-search-match.current .region {
  border-width: 2px;
  background-color: #afc4da;
}
atom-text-editor .vim-mode-plus-highlight-search .region,
atom-text-editor::shadow .vim-mode-plus-highlight-search .region {
  box-sizing: border-box;
  border-radius: 3px;
  border: 1px solid rgba(153, 153, 153, 0.3);
  background-color: #afc4da;
}
atom-workspace.vim-mode-plus-pane-maximized .tab-bar {
  display: none;
}
atom-workspace.vim-mode-plus-pane-maximized atom-pane-container {
  position: relative;
}
atom-workspace.vim-mode-plus-pane-maximized atom-pane-container atom-pane {
  display: none;
}
atom-workspace.vim-mode-plus-pane-maximized atom-pane-container atom-pane.active {
  display: flex;
  position: absolute;
  top: 0;
  right: 0;
  left: 0;
  bottom: 0;
  z-index: 100;
}
.vim-mode-plus-select-list .list-group .character-match {
  color: #2e2e2e;
  font-weight: bold;
}
